      /// <param name="clientIndex"></param>
      #if SILVERLIGHT
      IAsyncResult Begin_AsyncMatch_FindCompleteMatches(AsyncCallback callback, object state, int clientIndex);
      string End_AsyncMatch_FindCompleteMatches(IAsyncResult asyncResult);
      #endif
